import { useState } from 'react';
import Nav from 'react-bootstrap/Nav';
import './top_nav.css';

function PillsExample() {
  const [selectedTab, setSelectedTab] = useState('new'); // Initialize selectedTab state

  // Function to handle tab selection
  const handleTabSelect = (eventKey) => {
    setSelectedTab(eventKey);
  };

  // Function to render appointments based on selected tab
  const renderAppointments = () => {
    // Logic to determine which appointments to display based on selectedTab
    switch (selectedTab) {
      case 'new':
        return <div>New Appointments</div>;
      case 'suggested':
        return <div>Suggested Appointments</div>;
      case 'confirmed':
        return <div>Confirmed Appointments</div>;
      case 'canceled':
        return <div>Canceled Appointments</div>;
      case 'past':
        return <div>Past Appointments</div>;
      default:
        return null;
    }
  };

  return (
    <>
      <Nav variant="pills" defaultActiveKey="new" className="custom-nav">
        <Nav.Item>
          <Nav.Link eventKey="new" onSelect={handleTabSelect}>New Appointments</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="suggested" onSelect={handleTabSelect}>Suggested Appointments</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="confirmed" onSelect={handleTabSelect}>Confirmed Appointments</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="canceled" onSelect={handleTabSelect}>Canceled Appointments</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="past" onSelect={handleTabSelect}>Past Appointments</Nav.Link>
        </Nav.Item>
      </Nav>
      {renderAppointments()} {/* Render appointments based on selected tab */}
    </>
  );
}

export default PillsExample;
